<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>CODESYS</b> est un environnement de programmation d'automate qui permet une programmation selon la norme IEC-61131-3. Cet environnement facilitera l'édition de programmes dans les langages proposés par la norme précitée, le débogage des programmes, la simulation, la communication avec l'automate et le suivi du programme qui s'exécute sur ledit appareil. De manière générale, le principal avantage est qu'il est possible de développer des projets CPL. CODESYS est un logiciel commercial développé par 3S-Smart Software Solutions GmbH, une société allemande indépendante des fabricants de matériel ou de plateformes , et il est désormais possible de développer des applications avec lui pour les différentes marques d'automates qui ont fait confiance à son logiciel.

Il s'agit d'un environnement de programmation d'automatisation industrielle universel qui vous permet de programmer n'importe quel automate d'une grande variété de fabricants, intégrant les langages Ladder, SFC, CFC, ST, IL.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
